import React from 'react';
import AddIcon from '@material-ui/icons/Add';
export const CreateNotes = () => {
  return (
    <>
      <div className="text-center">
        <input type="text" placeholder="title" />
        <textarea placeholder="Write a Note..."></textarea>
        <button>
          <AddIcon />
        </button>
      </div>
    </>
  );
};
